  "Regulator Statement" : "HEARING PANEL DECISION RENDERED MARCH 4, 2002, WHEREIN  RESPONDENT IS FINED $10,000, WHICH FINE SHALL BE PAYABLE IN ACCORDANCE WITH THE TERMS OF AN INSTALLMENT PAYMENT PLAN TO BE AGREED UPON BY THE DEPARTMENT AND DAVENPORT IN HE RE-ENTERS THE SECURITIES INDUSTRY; SUSPENDED FROM ASSOCIATION WITH ANY MEMBER FIRM IN ANY CAPACITY FOR NINE MONTHS, HOWEVER DAVENPORT IS CREDITED WITH THE TIME HE HAS NOT BEEN WORKING IN THE INDUSTRY, THUS HIS SUSPENSION HAS BEEN SERVED; BARRED FROM OPENING A LEVERAGE TRADING ACCOUNT WITH ANY FIRM WITH WHICH HE ASSOCIATES UNTIL HE HAS REPAID ALL OF THE CUSTOMER LOANS IN FULL AND PAID THE FINE AND ORDERED TO PAY COSTS IN THE TOTAL AMOUNT OF $1,110.42.  IF NOT FURTHER ACTION, DECISION WILL BECOME FINAL APRIL 19, 2002.   CALLED FOR REVIEW BY THE NAC ON APRIL 9, 2002.  NAC DECISION RENDERED MAY 6, 2003 WHEREIN THE FINDINGS MADE ARE AFFIRMED AND SANCTIONS IMPOSED ARE AFFIRMED IN PART AND MODIFIED IN PART, THEREFORE, RESPONDENT IS FINED $10,000, $1,110.42 IN COSTS, AND A NINE-MONTH SUSPENSION FROM ASSOCIATION WITH ANY NASD MEMBER IN ANY CAPACITY. THE NINE-MONTH SUSPENSION IMPOSED BY THE NAC SHALL RUN FROM MARCH 4, 2002, THE DATE OF THE HEARING PANEL DECISION. THE SUSPENSION PERIOD THUS ENDED ON DECEMBER 4, 2002. IF NO FURTHER ACTION IS TAKEN, DECISION WILL BECOME FINAL JUNE 8, 2003. DECISION IS NOW FINAL AND EFFECTIVE IMMEDIATELY. FINES PAID.",
  "Broker Comment" : "WHEN DAVENPORT BECOMES ASSOCIATED WITH A MEMBER, UNLESS ENFORCEMENT EXTENDS THE TIME, ENFORCEMENT AND DAVENPORT WILL ARIVE AT AN INSTALLMENT PLAN.  THE INSTALLMENT PLAN WILL TAKE INTO ACCOUNT DAVENPORT'S PAYMENT OBLIGATIONS ON THE CUSTOMER LOANS AND WILL REQUIRE DAVENPORT TO PERIODICALLY REPORT TO ENFORCEMENT REGARDING THE STATUS OF THE LOANS.  ENFORCEMENT MAY ACCELERATE THE BALANCE DUE IN THE EVENT THAT DAVENPORT DEFAULTS ON HIS LOAN PAYMENTS."
